import React from "react";
import { NavLink } from "react-router-dom";
import { Navbar as BootstrapNavbar, Nav, Container } from "react-bootstrap";

// Ensure consistent naming for the component
const Navbar = () => {
  return (
    <BootstrapNavbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="/">CAPEX Gallery</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <NavLink to="/Items" className="nav-link" activeClassName="active">
              Items
            </NavLink>
            <NavLink to="/Profile" className="nav-link" activeClassName="active">
              Profile
            </NavLink>
            <NavLink to="/Reservations" className="nav-link" activeClassName="active">
              Reservations
            </NavLink>
            <NavLink to="/Login" className="nav-link" activeClassName="active">
              Login
            </NavLink>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </BootstrapNavbar>
  );
};

// Export the component using the chosen name
export default Navbar;
